data:
  definition: value expressing the relation between the active energy registered by
    a meter and the corresponding value of the test output.
  examples: []
  notes:
  - If this value is a number of pulses, the constant should be either pulses per
    kilowatt-hour (imp/kWh) or watt-hours per pulse (Wh/imp)
